import React, { Fragment, useState } from "react";
import "./List.css";

function List({ data }) {
  const [expanded, setExpand] = useState({
    isExpanded: false,
    expandedIndex: -1,
  });

  const handleListExpand = (index) => {
    console.log(data[index]);
    return setExpand({
      isExpanded: true,
      expandedIndex: index,
    });
  };

  return (
    <div className="list__container">
      <ul className="list__items">
        <li>Demand</li>
        <li>Stored Procedures</li>
        <li>Masters</li>
        <li>Profile</li>
        <li>Settings</li>
      </ul>
    </div>
  );
}

export default List;
